"use strict";const stringify=t=>"type"in t?stringifyToken(t):stringifyItem(t);function stringifyToken(t){switch(t.type){case"block-scalar":{let e="";for(const o of t.props)e+=stringifyToken(o);return e+t.source}case"block-map":case"block-seq":{let e="";for(const o of t.items)e+=stringifyItem(o);return e}case"flow-collection":{let e=t.start.source;for(const o of t.items)e+=stringifyItem(o);for(const o of t.end)e+=o.source;return e}case"document":{let e=stringifyItem(t);if(t.end)for(const o of t.end)e+=o.source;return e}default:{let e=t.source;if("end"in t&&t.end)for(const o of t.end)e+=o.source;return e}}}function stringifyItem({start:t,key:e,sep:o,value:n}){let r="";for(const e of t)r+=e.source;if(e&&(r+=stringifyToken(e)),o)for(const t of o)r+=t.source;return n&&(r+=stringifyToken(n)),r}exports.stringify=stringify;